function linkJetphotos(n){$.blockUI({message:""});$.ajax({type:"GET",url:"/Aircraft/Photo/"+n,cache:!1}).fail(function(){$.unblockUI();$("#photsearcherror").modal()}).done(function(n){$.unblockUI();n==null||n==""?$("#notexistphoto").modal():$.colorbox({href:n,iframe:!0,width:"80%",height:"90%"})})}function datatablesLangInit(){$.extend($.fn.dataTable.defaults,{language:{url:"https://cdn.datatables.net/plug-ins/9dcbecd42ad/i18n/Japanese.json"}})}